import { cookies } from "next/headers";
import TypewriterEffect from "@/components/TypewriterEffect";
import CtaButton from "@/components/CtaButton";
import TechStackSection from "@/sections/TechStackSection";
import ProjectSection from "@/sections/ProjectSection";
import SeeMoreButton from "@/components/SeeMoreButton";
import ServicesCard from "@/components/ServicesCard";
import EndSection from "@/sections/EndSection";
import Footer from "@/components/Footer";

export default async function Home() {
  const cookieStore = await cookies();
  const lang = cookieStore.get("lang")?.value || "az";

  const res = await fetch("http://localhost:4000/api/pages/hero", {
    cache: "no-store",
    headers: {
      "Content-Type": "application/json",
      "Accept-Language": lang,
    },
  });

  if (!res.ok) {
    throw new Error("Failed to fetch hero data");
  }

  const data = await res.json();

  return (
    <div>
      <main className={`flex flex-col  h-screen w-full  justify-center `}>
        <div className="w-20 h-20 rounded-full  border-black border-5 shadow-lg -mt-40 mb-10">
          {/* ! Change to Image component with image kit */}
          <img
            className="w-full h-full rounded-full"
            src={
              "data:image/jpeg;base64,"
            }
          />
        </div>
        <h1 className={`header-text font-bold `}>
          <TypewriterEffect
            stringsFromBackend={data.content?.heroText.split("_")}
          />
        </h1>
        <p className="text-[#00000080] w-1/4 text-16px">
          {data.content?.pageDescription}
        </p>
        <div className="flex gap-4 mt-10 ">
          <CtaButton innerText={data.content?.ctaButton} mode="start" />
          <button className="px-[clamp(16px,3vw,24px)] py-[clamp(10px,2.5vw,14px)] text-16px border border-neutral-300 text-black bg-white rounded-3xl ">
            {data.content?.contact}
          </button>
        </div>
        <div className="w-[90%] pt-20 ">
          <div className=" grid grid-cols-3 gap-4 text-[#00000080]  text-14px">
            <p className="">{data.content?.experience}</p>
            <p className="">{data.content?.location}</p>
            <p className="">{data.content?.freelance}</p>
          </div>
          <div className="grid grid-cols-3 gap-4  font-[600] text-24px">
            <p className="">{data.content?.experienceLength}</p>
            <p className="">{data.content?.locationData}</p>
            <p className="">{data.content?.freelanceStatus}</p>
          </div>
        </div>
      </main>

      <TechStackSection />

      <div className=" absolute left-0  w-screen bg-black mt-40 pt-20">
        <ProjectSection />
        <section className="text-white w-[90%] mx-auto mt-40 h-full">
          <div className="flex justify-between items-center mb-10">
            <h2 className="header-text font-[600] uppercase">Services</h2>
            <div>
              <SeeMoreButton innerText="Discover" />
            </div>
          </div>
          <div className="w-1/2  h-full mb-40 flex flex-col gap-10 ml-auto">
            <ServicesCard
              title="Frontend Development"
              icon="./favicon.ico"
              description="
                We create stunning and responsive user interfaces using the latest"
              list={["React", "Next.js", "Tailwind CSS"]}
              photo="data:image/jpeg;base64,"
            />
            <ServicesCard
              title="Frontend Development"
              icon="./favicon.ico"
              description="
                We create stunning and responsive user interfaces using the latest"
              list={["React", "Next.js", "Tailwind CSS"]}
              photo="data:image/jpeg;base64,"
            />
            <ServicesCard
              title="Frontend Development"
              icon="./favicon.ico"
              description="
                We create stunning and responsive user interfaces using the latest"
              list={["React", "Next.js", "Tailwind CSS"]}
              photo="data:image/jpeg;base64,"
            />
            <ServicesCard
              title="Frontend Development"
              icon="./favicon.ico"
              description="
                We create stunning and responsive user interfaces using the latest"
              list={["React", "Next.js", "Tailwind CSS"]}
              photo="data:image/jpeg;base64,"
            />
          </div>
        </section>

        <EndSection />
        <Footer />
      </div>
    </div>
  );
}
